import React from 'react'
import { Container, Row, Col } from 'react-bootstrap';

const Header = () =>{
    return(
        <Container>
          <Row>
            <Col className='Col1_Row1'>1 of 2</Col>
            <Col className='Col2_Row1'>2 of 2</Col>
          </Row>
        </Container>
    )
};

export default Header;
